import React, { Component } from 'react';
import { Navbar,Container,Nav,Image,Row,Col  } from 'react-bootstrap';
import portada from './assets/fuente-jardin2.jpg';
class Home extends Component{

   render(){

     <div className="Home">
     <Container>
        <Row>
        <Col xs={12} md={12} >
          <Image src={portada} fluid/>
          </Col>
        </Row>
     </Container> </div>

   }
}
export default Home;
